import  React  from "react";

import  SkillSub  from "./Skill_sub";

import  Reacts  from "./Photo/React.png";
const Skill = () =>{

    return (
    <section className="skill-box" id="skill-box">
            <h1 className="h1" style={{color: "aliceblue" }}>Skill</h1>
            <h5 className="h5" style={{color: "aliceblue" }}> what I Provide</h5>
            <div className="skill_card">
            <div className="card">
            <SkillSub imgs ={Reacts}></SkillSub>
            </div>
            <div className="card">
            <SkillSub></SkillSub>
            </div>
            <div className="card">
            <SkillSub></SkillSub>
            </div>
            </div>
    </section>
    )
}

export default Skill
